import { Component, Input } from '@angular/core'
import { ServiceService } from '../../services/service.service'
import { TableService } from '../../services/table.service'

@Component({
  selector: 'app-main',
  templateUrl: './main.component.html',
  styleUrls: ['./main.component.css'],
})
export class MainComponent {
  users: any
  user1: any
  constructor(
    private notification: ServiceService,
    private userData: TableService,
  ) {}
  notificationMessage: any = 'jhgjhg'
  ngOnInit() {
    this.notification.notificationSubject.subscribe((d) => {
      this.notificationMessage = d
      console.log(d, this.notificationMessage)
    })
    this.userData.users().subscribe((data) => {
      this.users = data
      this.user1 = this.users[0].id
      console.log(this.users)
    })
  }
}
